import React, { FunctionComponent } from 'react';

import Gallery from '../../../helper/Gallery';

import { GalleryButton } from '../../Button';
import { CustomButton, ListContainer } from './gallery-preview-list.style';

interface GalleryPreviewListProps {
    galleries: Gallery[]
}

const GalleryPreviewList: FunctionComponent<GalleryPreviewListProps> = ({ galleries }) => {

    return (
        <ListContainer>
            {galleries.map((gallery) => {
                return (
                    <ButtonContainer>
                        <CustomButton gallery={gallery} />
                    </ButtonContainer>
                )
            })}
        </ListContainer>
    );
}

export default GalleryPreviewList;
